import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <main>
      <header>
        <a href ="" className="logo">My Blog</a>
        <nav>
          <a href ="" >Login</a>
          <a href ="" >Register</a>
        </nav>
      </header>
      <div className="post">
        <img src="https://orhanergun.net/uploads/blog/thumbnail/BGP-Route-Advertisement.jpg" alt="BGP Route Advertisment"></img>
        <h2>BGP Route Advertisment</h2>
        <p>In a networking context, BGP route advertisement refers to the process of broadcasting routing information to neighboring routers. This is an important aspect of the Border Gateway Protocol (BGP), which is used for exchanging routing and reachability information among autonomous systems on the internet.</p>
      </div>
    </main>
  );
}

export default App;
